  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ohio River
  Islands National Wildlife Refuge outlines Refuge accomplishments during the 1997
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. Land acquisition is covered. The report includes a planning section
  which discusses the master plan, the management plan, and compliance with environmental
  and cultural resource mandates. Refuge administration is outlined; information about
  personnel, volunteer programs, funding, safety, and technical assistance is given.
  Habitat management is also covered; subjects include forests, haying, and pest control.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species (like freshwater mussels), marsh birds and waterbirds, raptors,
  and marking and banding. The public uses of the Refuge described in this report
  include outdoor classrooms, interpretive programs, hunting, fishing, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about rehabilitation, major maintenance, equipment replacement, communication
  systems, computer systems, and energy conservation. Items of interest and newspaper
  articles are included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
